import React from 'react';
import { Button, Container, Header, Image, Segment } from 'semantic-ui-react';
import { Link, withRouter } from 'react-router-dom';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const guestButtons = (
    <Container
      style={{ display: 'flex', justifyContent: 'flex-start' }}
      textAlign='center'
    >
      <Header as='h2' color='red' textAlign='center'>
        Telemed
        <Image src='../favicon.ico' />
      </Header>
      <Segment style={{ display: 'flex', justifyContent: 'flex-end' }}>
        <Button
          content='Login'
          onClick={() => history.push('/login')}
          inverted
          color='red'
        />
        <Button
          content='Sign Up'
          onClick={() => history.push('/signup')}
          inverted
          color='red'
        />
      </Segment>
    </Container>
  );

  const authButtons = (
    <Container text textAlign='justified'>
      <Header floated='left' as='h2' color='red' textAlign='center'>
        Telemed
        <Image src='../favicon.ico' />
      </Header>
      <Button
        onClick={() => history.push('/search')}
        inverted
        color='red'
        content='Search'
      />

      <Button
        content='Profile'
        onClick={() => history.push('/profile')}
        inverted
        color='red'
      />
      <Button inverted content='Logout' color='red' onClick={logout} />
    </Container>
  );
  return <>{currentUser ? authButtons : guestButtons}</>;
};

export default withRouter(NavBar);
